import React from "react";
import "./App.css";
import Logo from "./logo/logo";
import Text from "./text/text";

function App() {
  return (
    <div className="App">
      <Logo />;
      <Text
        title="Say Hello to React JS!"
        txt="You will learn a forntedn Framework from scratch and it is so goooddd!You
      will love it!"
      />
    </div>
  );
}

export default App;
